@keyframes rainbow
{
  0%
  {
    background-color: #365d9b;
    border-color: #365d9b;
  }

  14%
  {
    background-color: #4a76bb;
    border-color: #5c8bd7;
  }

  28%
  {
    background-color: #87b6ff;
    border-color: #91bcff;
  }

  42%
  {
    background-color: #6ea3f7;
    border-color: #6ea3f7;
  }

  100%
  {
    background-color: #365d9b;
    border-color: #4a76bb;
  }
}

